import react, { useState } from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/esm/Button';
import { Link, Routes, Route, useNavigate } from 'react-router-dom';
import ReactDOM from 'react-dom';

const UserNavBar = () => {
    return ( 
        <div sticky="top" className="navbar mt-5">
            <Container display="fluid">
                <Navbar.Brand href="#hero">Ulete</Navbar.Brand>
                <div className="ml-auto">
                        <Link to="/home" className="me-5 text-center fw-bold nav-item">Home</Link>
                            <Link to="/DailyGoals" className="me-5 text-cente fw-bold nav-item">Goals</Link>
                            <Link className="me-5 text-cente fw-bold nav-item">Trackers</Link>
                            <Link className="me-5 text-cente fw-bold nav-item">Resources</Link>
                            <i class="bi bi-person-circle "></i>
                </div>
            </Container>
        </div>
     );
}

export default UserNavBar;
